title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o16585.m31 -> o16583.m21 -> o16585.m31
  o16585.m5 -> o16583.m21 -> o16585.m31 -> o16583.m21
  o16583.m21 -> o16585.m31 -> o16583.m21

features:
  - inheritance
  - overriding
  - method
  - polymorphism

